// src/components/ViewJudgment.js
import React from 'react';
import { useParams } from 'react-router-dom';
import '../styles/ViewUploadJudgment.css'; // Import CSS file

function ViewJudgment() {
  const { state } = useParams();

  return (
    <div className="view-judgment">
      <div className="container">
        <h1 className="title">View Judgment for {state.replace(/-/g, ' ')}</h1>
        <div className="judgment-list">
          <p>Judgments for {state.replace(/-/g, ' ')} will be displayed here.</p>
          {/* Add judgment data here */}
        </div>
      </div>
    </div>
  );
}

export default ViewJudgment;
